        React.createElement("path", { d: "M5 1.5c0-.28.22-.5.5-.5h4a.5.5 0 010 1h-4a.5.5 0 01-.5-.5z", fill: primaryFill }),
        React.createElement("path", { d: "M7.5 5a.5.5 0 00-.5.5v4a.5.5 0 001 0v-4a.5.5 0 00-.5-.5z", fill: primaryFill }),
        React.createElement("path", { d: "M13.5 9a6 6 0 11-12 0 6 6 0 0112 0zm-1 0a5 5 0 10-10 0 5 5 0 0010 0z", fill: primaryFill }),
        React.createElement("path", { d: "M12.45 2.64a.5.5 0 10-.7.7l1.4 1.41a.5.5 0 10.7-.7l-1.4-1.4z", fill: primaryFill }));
};
const Timer16Regular = wrapIcon(rawSvg({}), 'Timer16Regular');
export default Timer16Regular;
